<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>查看密码与授权码</title>
    <style>
        body {
            font-family: 'Arial', sans-serif;
            background-color: #f4f4f9;
            margin: 0;
            padding: 0;
            display: flex;
            justify-content: center;
            align-items: center;
            height: 100vh;
        }
        .container {
            background-color: #fff;
            border-radius: 10px;
            box-shadow: 0 0 10px rgba(0, 0, 0, 0.1);
            padding: 20px;
            width: 400px; /* 调整宽度 */
            text-align: center;
        }
        h1 {
            font-size: 24px;
            margin-bottom: 20px;
            color: #333;
        }
        input[type="password"] {
            width: 100%;
            padding: 10px;
            margin-bottom: 10px;
            border: 1px solid #ccc;
            border-radius: 5px;
            font-size: 16px;
        }
        button {
            width: 100%;
            padding: 10px;
            background-color: #007bff;
            border: none;
            border-radius: 5px;
            color: #fff;
            font-size: 16px;
            cursor: pointer;
        }
        button:hover {
            background-color: #0056b3;
        }
        .result {
            margin-top: 20px;
            font-size: 16px;
            text-align: left;
        }
        .error {
            color: red;
        }
        table {
            width: 100%; /* 表格宽度适应父容器 */
            border-collapse: collapse;
            margin-top: 20px;
        }
        th, td {
            padding: 10px;
            border: 1px solid #ddd;
            text-align: center;
            white-space: normal; /* 允许内容换行 */
            word-wrap: break-word; /* 确保长单词或URL换行 */
        }
        th {
            background-color: #f2f2f2;
        }
    </style>
</head>
<body>
    <div class="container">
        <h1>密码验证</h1>
        <div style="display: flex; flex-direction: column; align-items: center;">
            <input type="password" id="password" placeholder="请输入密码" style="width: 100%; max-width: 360px;">
            <button onclick="checkPassword()" style="width: 100%; max-width: 360px; margin-top: 10px;">验证</button>
        </div>
        <div class="result" id="result"></div>
        <table id="data-table" style="display: none;">
            <thead>
                <tr>
                    <th>姓名</th>
                    <th>违反日期</th>
                    <th>违反原因</th>
                    <th>发放日期</th>
                    <th>次数</th>
                </tr>
            </thead>
            <tbody>
                <!-- 数据行将在这里动态生成 -->
            </tbody>
        </table>
    </div>
